import React from 'react';
import Carousel from '../components/Carousel';
import Info from '../components/Info';
import Table from '../components/Table';
import Text from '../components/Text';


const Home = () => {
  return (
    <div className='flex'>
        <Carousel />
        <Info />
        <Table/>
        <Text />
    </div>
  )
}

export default Home
